import React from 'react';
import WrappedMap from "../Map";
const mapplaces = [
    {
        'name': "This is the name",
        lat: 9,
        lng: 39
    }
];


const Mapview = () => {
    return (
        <>
            <div style={{ width: "100wh", height: "600px"}}>
                <WrappedMap
                    places={mapplaces}
                    googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyCRNebshVW6XSdv4X2Nxm3FGIt3qbA7UKU&callback=initMap&v=3.exp&libraries=geometry,drawing,places"
                    loadingElement={<div style={{ height: "100%" }} />}
                    containerElement={<div style={{ height: "100%" }} />}
                    mapElement={<div style={{ height: "100%" }} />}
                />
            </div>
        </>
    );
}

export default Mapview;
